Technology Documentary hosted by Tony Hirst, published by National Geographic broadcasted as part of NG Megafactories series in 2012 - English narration


Information
------------------------------

Megafactories 
They're sleek. They're speedy. And they all started life in a Megafactory.
Megafactories: Lotus Evora
Norfolk isn't an obvious choice for a megafactory, but the rural county has been home to Lotus since 1966. Join CEO Dany Bahar as he unveils plans for their latest super car: the Evora.

